import styled from "styled-components";

export const H1 = styled.div`
    font-family: Inter;
    font-size: 48px;
    font-style: normal;
    font-weight: 400;
    line-height: 60px;
    letter-spacing: -0.01em;
    text-align: left;
`;
export const Flex = styled.div`
  display: flex;
  div{
    min-width: 250px;
  }
`;
export const FlexColumn = styled.div`
  display: flex;
  flex-direction: column;
`;
